INSERT INTO Jobs VALUES(2,"Software Developer","Humane is innovating at the cutting edge of human and computer interaction, with our CosmOS AI operating system and Ai Pin hardware that help our customers stay connected to the world around them. As a Web Engineering Intern at Humane, you will invent and build new ways of interacting with the CosmOS AI and our users’ data. Your contributions will help to shape the future of our web interfaces and impact the way Cosmos AI and Ai Pin users navigate and access their information every day.", "San Francisco,CA", 250000 ,"28-Oct-2024", 25);
